import React from 'react'
import "./Header.css"
function Header() {

    return (
        // logo // Search Box // Sign In // Returns and Orders // Prime // Cart
        <nav className="header">
            <img className="logo" src="https://img.favpng.com/19/15/8/amazon-com-portable-network-graphics-transparency-logo-image-png-favpng-8Q7i6DhJBRCnAYytKhxLqVkdb.jpg" alt=""/>

        </nav>
    )
}

export default Header
